import React from "react";

function Portfolio() {
  return (
    <section id="portfolio" className="min-h-screen flex flex-col justify-center items-center text-center px-6 bg-white">
      <h2 className="text-3xl font-bold text-gray-900">Portfolio</h2>
      <p className="text-lg text-gray-700 mt-4">Check out my latest work.</p>
    </section>
  );
}

export default Portfolio;
